INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 0, "春咲 ひより", 0, 0, 1001, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 0, "草野 優衣", 0, 0, 1002, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "フェンシングを始めてみては？", "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 0, "士条 怜", 0, 0, 1003, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 0, "穂高 みそぎ", 0, 0, 1004, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "風宮あかりです", "私といっしょに…\nいかない？", "ねぇ…", 0, "風宮 あかり", 0, 0, 1006, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "出雲宮子なのー", "食べ物の恨みは怖いのー", "プリンたべたいのー", 0, "出雲 宮子", 0, 0, 1007, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "ボクは虹村雪。", "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "虹村 雪", 0, 0, 1008, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "柊杏奈", 0, 0, 1009, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "姫宮 真歩", 0, 0, 1010, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "衣之咲璃乃です！", "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲 璃乃", 0, 0, 1011, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 0, "柏崎 初音", 0, 0, 1012, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 0, "美波 鈴奈", 0, 0, 1016, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 0, "喜屋武 香織", 0, 0, 1017, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "支倉伊緒です。", "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 0, "支倉 伊緒", 0, 0, 1018, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 0, "茜 ミミ", 0, 0, 1020, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……", "あの……\nふぇ……", 0, "栗林 くるみ", 0, 0, 1021, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "風宮よりです。\nあああああ！", "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 0, "風宮 より", 0, 0, 1022, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 0, "北条 綾音", 0, 0, 1023, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, "天野 すずめ", 0, 0, 1025, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 0, "倉石 恵理子", 0, 0, 1027, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木 咲恋", 0, 0, 1028, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井 望", 0, 0, 1029, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, "ニノン・ジュベール", 0, 0, 1030, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜 しのぶ", 0, 0, 1031, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 0, "野戸まひる", 0, 0, 1033, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 0, "綾瀬 ゆかり", 0, 0, 1034, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "氷川鏡華…です", "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 0, "氷川 鏡華", 0, 0, 1036, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "柏崎…栞です。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 0, "柏崎 栞", 0, 0, 1038, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "ふ、双葉碧です。", "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 0, "双葉 碧", 0, 0, 1040, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "三角千歌です。", "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角 千歌", 0, 0, 1042, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "安芸真琴だ。", "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 0, "安芸 真琴", 0, 0, 1043, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "わらわこそは夜を総べる者！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 0, "イリヤ・オーンスタイン", 0, 0, 1044, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "そこで騎士は妖精を乱暴に……", "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 0, "遠見 空花", 0, 0, 1045, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまき", 0, 0, 1046, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "大神美冬よ！", "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 0, "大神 美冬", 0, 0, 1048, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "星野静流だよ！", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 0, "星野静流", 0, 0, 1049, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.5, 0, 1, "アタシは玉泉美咲。", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 0, "玉泉美咲", 0, 0, 1050, 1, 1);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 2, 1.4, 0, 1, "？？？", "？？？？", "？？？？", 0, "リマ", 0, 0, 1052, 1, 1);
